import * as React from 'react';
import { styled } from '@mui/material/styles';
import './About.css'
import Avatar from '@mui/material/Avatar';
import Grid from '@mui/material/Unstable_Grid2';
import Paper from '@mui/material/Paper';
import Box from '@mui/material/Box';
import Author from './about/avatar/Author'


const Div = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    fontSize: "3em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"

}));

const Dive = styled('div')(({ theme }) => ({

    ...theme.typography.button,
    fontSize: "1em",
    fontFamily: "'Source Sans Pro', 'sans-serif'"
}));

const Item = styled(Paper)(({ theme }) => ({
    backgroundColor: theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
}));

function About() {

    return (
        <Box sx={{ width: '100%' }}>
            <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
                <Grid xs={6}>
                    <div className="container" >
                        <Div>Hi, I'm Austin</Div>
                        <Dive>Im a product designer based in Sydney, Australia with experience in delivering end-to-end UX/UI design for software products. Im passionate about improving the lives of others through design and am constantly looking to learn new things everyday.</Dive>
                    </div>
                </Grid>
                <Grid xs={6}>
                    <Avatar alt="Cindy Baker" src="./src/components/body/author.png" />

                </Grid>
            </Grid>
        </Box>

    );
}
export default About;
